    <label>First Number</label>
    <input type="number" 
     placeholder="First Number"
     value={number.num1}
   />
  </div>
  <div class="field">
    <label>2nd Number</label>
    <input type="number"  placeholder="2nd Number"/>
  </div>
  <button class="ui button" type="submit">Add</button>
  </form>
    </div>
};
export default Calculator;
